text:
"พ่อของลูกในท้องเธอ"  อ่อยยยย​ อันนี้เขินมากกกกก​ ลุงแกก็แซ่บใช่ย่อยนะน้องไทม์ก็ไม่เบา​ เค้าจูบกันอีกแล้ว​ &gt;.&lt;
นี่คิดว่าถ้าวัจจีรู้เรื่องมีหวังบ้านบึ้ม​ เผลอเรียกสินสอดเป็นธุรกิจของมิสเตอร์คอนเนอร์​ หมดตัวแน่ลุง​ 55555
